import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Home from './page/Home';
import './App.css';
import Login from './page/Login';
import Trip from './page/Trip';
import User from './page/User';
import PrivateRoute from './components/Protected Route/Protected';
import Schedule from './page/Schedule/Schedule';
import UserFAQ from './page/UserFAQ/UserFAQ';
import Setting from './page/Setting/Setting';
import Test1 from './page/Test1';
import Join from './page/JoinPage/JoinStep1/Join';
import JoinStep2 from './page/JoinPage/JoinStep2/JoinStep2';
import WeatherApp from './page/WeatherPage/WeatherApp';
import Test2 from './page/Test2';


const App = () => {
    const axios = require('axios');

const serviceKey = '발급받은_API_키';  // 발급받은 API 키
const url = 'http://apis.data.go.kr/B551011/TarRlteTarService';  // API 엔드포인트

// 파라미터 설정
const params = {
  serviceKey: serviceKey,
  numOfRows: 10,            // 한 번에 불러올 데이터 수
  pageNo: 1,                // 페이지 번호
  MobileOS: 'ETC',          // 호출하는 OS 종류
  MobileApp: 'TestApp',      // 호출하는 앱 이름
  _type: 'json',            // 응답 형식을 JSON으로 지정
};

// Axios를 사용하여 GET 요청
axios.get(url, { params })
  .then(response => {
    console.log(response.data);  // 받아온 데이터 출력
  })
  .catch(error => {
    console.error('Error:', error);  // 에러 발생 시 출력
  });

  
    return (
        <Router>
            <Routes>
                <Route path="/" element={<Home />} />
                <Route path='/Login' element={<Login />} />
                <Route path='/Trip' element={<Trip />} />
                <Route path='/User' element={
                     <PrivateRoute> <User /></PrivateRoute>}/>  
                     
                <Route path='/User/FAQ' element={<UserFAQ/>} />
                <Route path='/User/Schedule' element={<Schedule/>}/>    
                <Route path='/User/Setting' element={<Setting/>}/>
                <Route path='/Join' element={<Join />} />
                <Route path='/Join/step2' element={<JoinStep2 />} />
                <Route path='/Weather' element={<WeatherApp />} />
                <Route path='/Test1' element={<Test1 />} />
                <Route path='/Test2' element={<Test2 />} />

            </Routes>
        </Router>
    );
}

export default App;
